define('views/guicore/componentDetailView',['require','jquery','underscore','backbone','views/guicore/Fields/FieldView','text!templates/Fields/DetailField.html','text!templates/DetailView.html'],function(require) {
    'use strict';
    var $ = require('jquery');
    var _ = require('underscore');
    var Backbone = require('backbone');

    var FieldView = require('views/guicore/Fields/FieldView');

    var detailFieldTemplate = require('text!templates/Fields/DetailField.html');
    var template = require('text!templates/DetailView.html');

    var componentDetailView = Backbone.View.extend({
        _cachedViews: [],
        _cachedCollection: null,
        _cachedCollectionLength: null,

        events: {
            'click .data-repr': 'dataReprClicked'
        },

        initialize: function() {
            _.bindAll(this);
            this.template = Handlebars.compile(detailFieldTemplate);
            this.$el.append(Handlebars.compile(template));
            this.$fieldset = this.$el.find('fieldset');
        },

        //: TODO this should be redone and re optimized for finer grained updates
        render: function(spec) {
            if (spec && spec.collectionContext) {
                //: if this collection is the cached collection or if it is the same collection object
                //: but the length has changed then rerender
                if (this._cachedCollection !== spec.collectionContext ||
                    (this._cachedCollection === spec.collectionContext &&
                     this._cachedCollectionLength !== spec.collectionContext.length)) {
                        this.destroyAll();
                        this._cachedCollection = spec.collectionContext;
                        this._cachedCollectionLength = this._cachedCollection.length;
                        _.each(this._cachedCollection.models, this.addOne);
                }
            //: spec was not passed. just rerender the cached collection if it exists
            //: this is usually called after a destroyOne was triggered
            } else if (this._cachedCollection) {
                this.destroyAll();
                this._cachedCollectionLength = this._cachedCollection.length;
                _.each(this._cachedCollection.models, this.addOne);
            }
            return this;
        },

        destroyOne: function(view) {
            //: before destroying an element, save its data
            if (view.model.schema.nodeType === 'e') {
                view.model.set('data', view.$el.find('.data-repr').val());
            }
            view.destroy();
        },

        destroyAll: function() {
            _.each(this._cachedViews, this.destroyOne);
            //: empty the cached view array
            this._cachedViews.length = 0;
        },

        addOne: function(model) {
            var field;
            field = new FieldView({ model: model });
            this._cachedViews.push(field);
            this.$fieldset.append(field.render().$el);
        },

        dataReprClicked: function(e) {
            this.trigger('click:dataRepr', {
                ctx: this, event: e, id: $(e.target).attr('id').substring(5)
            });
        }
    });

    return new componentDetailView({ el: $('#detail-panel') });
});

define('views/guicore/contextMenuView',['require','jquery','underscore','backbone'],function(require) {
    'use strict';
    var $ = require('jquery');
    var _ = require('underscore');
    var Backbone = require('backbone');

    var contextMenuView = Backbone.View.extend({
        tagName: 'div',
        id: 'cmenu',
        className: '',
        isVisible: false,
        _cachedTargetView: null,

        initialize: function(options) {
            _.bindAll(this);
            this.$body = $('body').on('mousedown', this._onMouseDown);
            //: we append to the body so and not on the contextView
            //: so that we only need to append once
            this.$body.append(this.$el.hide());
            this.$options = $('<ul/>', { 'class': 'cmenu-options' });
            this.$el.append(this.$options);
        },

        render: function(spec) {
            //: stopPropagation() here to prevent $body triggering an
            //: onmousedown which causes the contextmenu(when we actually want to show it)
            //: to be hidden
            spec.event.stopPropagation();
            //: call hide ahead of replacing the old cached view
            //: this makes sure that we can reset the old cached view's state
            //: if needed.
            this.$el.hide(spec.event);
            this.$options.empty();
            this._cachedTargetView = spec.ctx;
            this.createMenuOptions(this._cachedTargetView.menu);
            //: recalculate position by using e.pageX/pageY
            this.$el.css({
                'display': '',
                'position': 'absolute',
                'z-index': '1000',
                'left': spec.event.pageX + 'px',
                'top': spec.event.pageY + 'px',
                'height': '350px',
                'width': '150px'
            });
            this.isVisible = true;
            return this;
        },

        hide: function(e) {
            if (this._cachedTargetView) {
                this.$el.hide();
                this.isVisible = false;
            }
            this._cachedTargetView = null;
            return this;
        },

        _onMouseDown: function(e) {
            if (this.isVisible) {
                this.hide(e);
            }
        },

        createMenuOptions: function(menuObj) {
            _.each(menuObj, this.createMenuListItems);
        },

        createMenuListItems: function(value, key) {
            var $listItem = $('<li/>');
            var $link = $('<a/>', { 'href': '#', 'text': key});
            $link.on('mousedown', function(e) {
                if (e.which == 1) {
                    //: value should be the callback
                    value(e);
                }
            });
            this.$options.append($listItem.append($link));
        }
    });
    
    //: assures that contextMenuView is a singleton
    return new contextMenuView();
});

